import React from "react";
import styled from "styled-components";
import Navbar from "../single_comps/page1Comps/Navbar";
import Diamond from "../single_comps/page1Comps/Diamond";
import SearchBar from "../single_comps/page1Comps/SearchBar";
import SetProducts from "../single_comps/page1Comps/SetProducts";
import Products from "../single_comps/page1Comps/Products";
import Menue_prods from "../single_comps/page1Comps/Menue_prods";
import MidCards from "../single_comps/page1Comps/MidCards";

const TopDiv = styled.div`
  width: 100%;
  height: 1200px;
  overflow: hidden;
`;
const MidDiv1 = styled.div`
  display: flex;
  margin-top: 140px;
  width: 1900px;
  height: 600px;
  border: 1px solid black;
  gap: 200px;
  padding-left: 200px;
  align-items: center;
`;
const MidDiv2 = styled.div`
  margin-top: 140px;
  width: 100%;
  height: 2000px;
`;
const MidDiv3 = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  margin-top: 140px;
  width: 1600px;
  height: 2000px;
  margin-left: auto;
  margin-right: auto;
  border: 1px solid black;
`;
const FootDiv = styled.div`
  margin-top: 140px;
  width: 100%;
  height: 30%;
`;
function Home() {
  return (
    <div>
      <TopDiv>
        <Navbar />
        <Diamond />
      </TopDiv>
      <MidDiv1>
        <h1>132</h1>
        <Menue_prods />
      </MidDiv1>
      <MidDiv2>
        <SearchBar />
        <SetProducts />
        <Products />
      </MidDiv2>
      <MidDiv3>
        <MidCards />
        <MidCards />
      </MidDiv3>
      <FootDiv></FootDiv>
    </div>
  );
}

export default Home;
